import React from 'react';
import ExpenseItem from './ExpenseItem';

const ExpenseList = () => {
    return (
        <>
            <input 
                type='text'
                className='form-control mb-2 mr-sm-2'
                placeholder='Search an expense'
            />
            <ul className='list-group'>
                <ExpenseItem />
            </ul>
        </>
    )
}

export default ExpenseList;
